import GetRequest from '../Utility/HttpRequests'
import React, { Component, useState, useEffect } from 'react'

const [weather, setWeather] = useState(null);

 function Weather() {
  const data = GetRequest("https://api.open-meteo.com/v1/forecast?latitude=46.253468&longitude=16.615731&current_weather=true&hourly=temperature_2m,relativehumidity_2m,windspeed_10m");
  data.then(response => setWeather(response.data));
  return render();
}

function render() {
  return (
    <div className='WeatherPage'>
      <div className='header'><h2>WEATHER</h2></div>
      <div>
      <p>{JSON.stringify(weather)}</p>
      </div>
    </div>
  )
}
export default Weather
